import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'
import utilStyles from '../styles/utils.module.css'
import Link from 'next/link'
import Date from '../components/date'
import { GetStaticProps } from 'next'
import Header from '../components/header'
import Nav from '../components/navBar/NavBar'
import styles from './page_styles/home.module.scss'
import React from 'react'

const DesktopMain =()=>{
  return(
    <div className={styles.mainContainerItems}>
      <Link href='/about'><div className={styles.mainContainerTitle}> Explore my World</div></Link>
      
      </div>
  )
}

const MobileMain =()=>{
  return(
    <div className={styles.mainContainerItems}>
      <div className={styles.blur_background}>
      <div className={styles.mainContainerTitle}>Exploring<br></br>my Potential</div>
      <a href='/about' className={styles.homeButton}>about me</a>
      <a href='/projects' className={styles.homeButton}>my works</a>
      </div>
      </div>
  )
}


const bio: String = 'dfsfd';
export default function Home({
  allPostsData
}: {
  allPostsData: {
    date: string
    title: string
    id: string
  }[]
}) {
  return (

    <div>

      <Head>
        <title>{siteTitle}</title>
      </Head>
      <div className={styles.mainContainer}>
        <div className={styles.container}>yuhangang</div>
      <MobileMain/>
      
      </div>
   






    
    </div>
  )
}
